import React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import Cookies from "js-cookie";
import axios from 'axios';


const Menu=()=> {
  const [selectedMenu,setSelectedMenu]=useState(0);
  const [isProfileDropdownOpen,setIsProfileDropdownOpen]=useState(false);
  const [user, setUser] = useState(null);
  const handleMenuClick=(index)=>
  {
    setSelectedMenu(index);
  }
  const handleProfileClick = (index) => {
    setIsProfileDropdownOpen(!isProfileDropdownOpen);
  };

 const [errorMessage, setErrorMessage] = useState("");
  const handleLogout = async () => {
    try {
      // Call the backend API to log out the user
      await axios.post('http://localhost:8080/logout');

      // Clear the cookie on the client-side
      Cookies.remove('user');
      Cookies.remove('token');

      // Redirect to the login page
      window.location.href='http://localhost:3001/';
    } catch (error) {
      console.error('Logout failed', error);
      setErrorMessage("Logour failed ");
    }
  };


  const menuClass = "menu";
  const activeMenuClass = "menu selected";
  React.useEffect(() => {
    try {
      const userCookie = Cookies.get('user');
      if (userCookie) {
        setUser(JSON.parse(userCookie));
      }
    } catch (error) {
      console.error('Failed to parse user cookie', error);
    }
  }, []);

  return ( 
     <div className='menu-container'>
       <img src="logo.png" style={{width:"50px"}}></img>
       <div className='menus'>
       {errorMessage && <p>{errorMessage}</p>} {/* Display error message if it exists */}
        <ul>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="/"
              onClick={() => handleMenuClick(0)}
            >
              <p className={selectedMenu === 0 ? activeMenuClass : menuClass}>
                Dashboard
              </p>
            </Link>
         </li>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="/orders"
              onClick={() => handleMenuClick(1)}
            >
              <p className={selectedMenu === 1 ? activeMenuClass : menuClass}>
                Orders
              </p>
            </Link>
         </li>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="/holdings"
              onClick={() => handleMenuClick(2)}
            >
              <p className={selectedMenu === 2 ? activeMenuClass : menuClass}>
                Holdings
              </p>
            </Link>
         </li>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="/positions"
              onClick={() => handleMenuClick(3)}
            >
              <p className={selectedMenu === 3 ? activeMenuClass : menuClass}>
                Positions
              </p>
            </Link>
         </li>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="funds"
              onClick={() => handleMenuClick(4)}
            >
              <p className={selectedMenu === 4 ? activeMenuClass : menuClass}>
                Funds
              </p>
            </Link>
         </li>
         <li>
         <Link
              style={{ textDecoration: "none" }}
              to="/apps"
              onClick={() => handleMenuClick(6)}
            >
              <p className={selectedMenu === 6 ? activeMenuClass : menuClass}>
                Apps
              </p>
            </Link>
         </li>


        </ul>
        <hr />
        <div className="profile" onClick={handleProfileClick}>
          <div className="avatar">{user.username.charAt(0).toUpperCase()}</div>

        </div>
        <button className="logout-btn" onClick={handleLogout} style={{color:"blue", backgroundColor:"white",border:"none",}}>
          Logout
        </button>

       </div>
     </div>
   );
}

export default  Menu;
